button:focus, button:active, button:hover {
	/* 20% Overlay 2, 80% mantle */
	background-color: rgb(48, 50, 66);
	outline-style: none;
}

/* General button styling (applies to all buttons) */
button {
    min-width: 60px;
    min-height: 60px;
    background-size: 24px;
    background-repeat: no-repeat;
    background-position: center;
    background-color: #000000;
    color: #ffffff;
    border: 2px solid #f10000;
    border-radius: 10px;
    margin: 10px;
}

/* Lock button */
button#lock {
    background-image: url("/home/khalyl/.config/wlogout/icons/lock.svg");
}

/* Hibernate button */
button#hibernate {
    background-image: url("/home/khalyl/.config/wlogout/icons/hibernate.svg");
}

/* Logout button */
button#logout {
    background-image: url("/home/khalyl/.config/wlogout/icons/logout.svg");
}

/* Shutdown button */
button#shutdown {
    background-image: url("/home/khalyl/.config/wlogout/icons/power-off.svg");
}

/* Suspend button */
button#suspend {
    background-image: url("/home/khalyl/.config/wlogout/icons/suspend.svg");
}

/* Reboot button */
button#reboot {
    background-image: url("/home/khalyl/.config/wlogout/icons/reboot.svg");
}

